import React, { useState } from "react";
import { GoogleMap, useLoadScript, Autocomplete } from "@react-google-maps/api";
import "../../styles/flowTwo/StepThree2.css";
import Header from "../UserFlowOne/Header";
import Footer from "./Footer";

const libraries = ["places"];

const StepThree2 = () => {
  const { isLoaded, loadError } = useLoadScript({
    googleMapsApiKey: "AIzaSyDWhkFt7OHdCThlWPor0VKO8iu7JYKHrpI", // Replace with your API key
    libraries,
  });

  const [selectedCoverage, setSelectedCoverage] = useState("standard");
  const [formData, setFormData] = useState({
    address: "",
    city: "",
    state: "",
    zip: "",
  });

  const [autocomplete, setAutocomplete] = useState(null);

  const handlePlaceSelect = () => {
    const place = autocomplete.getPlace();
    const addressComponents = place.address_components;

    const getComponent = (type) =>
      addressComponents.find((component) => component.types.includes(type))
        ?.long_name;

    setFormData({
      address: place.formatted_address || "",
      city: getComponent("locality") || "",
      state: getComponent("administrative_area_level_1") || "",
      zip: getComponent("postal_code") || "",
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Form submitted: " + JSON.stringify(formData));
  };

  if (loadError) return <div>Error loading maps</div>;
  if (!isLoaded) return <div>Loading...</div>;

  return (
    <div>
      <Header />
      <div className="quote-form-container">
        <h3 className="title">
          <span className="step-number">3.</span> Contact Details and See Quote
        </h3>
        <form className="form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Street Address</label>
            <Autocomplete
              onLoad={(autocomplete) => setAutocomplete(autocomplete)}
              onPlaceChanged={handlePlaceSelect}
            >
              <input
                type="text"
                name="address"
                placeholder="Ex: 123 Main St."
                value={formData.address}
                onChange={(e) =>
                  setFormData({ ...formData, address: e.target.value })
                }
                required
              />
            </Autocomplete>
          </div>
          <div className="form-group">
            <label>City</label>
            <input
              type="text"
              name="city"
              value={formData.city}
              readOnly
              placeholder="City will autofill"
            />
          </div>
          <div className="form-group">
            <label>State</label>
            <input
              type="text"
              name="state"
              value={formData.state}
              readOnly
              placeholder="State will autofill"
            />
          </div>
          <div className="form-group">
            <label>ZIP Code</label>
            <input
              type="text"
              name="zip"
              value={formData.zip}
              readOnly
              placeholder="ZIP Code will autofill"
            />
          </div>

          <h4 className="coverage-title">
            What type of rates do you want to see?
          </h4>
          <p className="coverage-description">Select a coverage option.</p>

          <button type="submit" className="get-quote-button1">
            Get Quote
          </button>
        </form>
      </div>
      <Footer />
    </div>
  );
};

export default StepThree2;
